import Ssilki from "./components/Ssilki";

function Header(props) {
    const linksElements = props.links.map((link) => {
    return <a className='nav' href="#">{link}</a>
  })

    return (
      <header>
        <nav className='nav-decoration'>
          {linksElements}
        </nav>
      </header>
    )
  }
  
  export default Header;
